<?php
class Foo{}

class Foos
{
    /** @var list<Foo> */
    private array $foos;

    /** @param list<Foo> $foos */
    public function __construct(array $foos)
    {
        Assert::allIsInstanceOf($foos, Foo::class);

        $this->foos = $foos;
    }
}

/** @see https://github.com/webmozarts/assert/blob/f07851c5b43e4cb502c24068620e9af6cbdd953f/src/Mixin.php#L621-L638 */
class Assert {

     /**
     * @psalm-pure
     * @psalm-template ExpectedType of object
     * @psalm-param class-string<ExpectedType> $class
     * @psalm-assert iterable<ExpectedType> $value
     *
     * @param mixed         $value
     * @param string|object $class
     * @param string        $message
     *
     * @throws InvalidArgumentException
     *
     * @return void
     */
    public static function allIsInstanceOf($value, $class, $message = ''): void
    {
    }   
}
```

